import * as monaco from 'monaco-editor';
try {
    var codiconFont = new FontFace('codicon', 'url(data:application/x-font-ttf;charset=utf-8;base64,)');
    codiconFont.load().then(function(loaded_face) {
        document.fonts.add(loaded_face);
    }).catch(function(error) {
        console.error(error);
    });
} catch (e) {
    console.error(e);
}